import {MDBContainer} from "mdbreact";
import React from "react";
import {Radar} from "react-chartjs-2";

export type RadarChartProps={
  RadarChartData:any;
}

const RadarChartV=(props:RadarChartProps)=>{

    return (
      <MDBContainer>
        <h3 className="mt-5">Radar chart</h3>
        <Radar  data={props?.RadarChartData} options={{ responsive: true }} height={200}/>
      </MDBContainer>
    );
  }

export default RadarChartV;
